// Helper function to truncate documentation
func truncateDoc(doc string) string {
	lines := strings.Split(doc, "\n")
	if len(lines) > 3 {
		return strings.Join(lines[:3], " ") + "..."
	}
	if len(doc) > 200 {
		return doc[:200] + "..."
	}
	return doc
}

